import React, { useState } from 'react';
import NavBar from '../NavBar.js';
import '../../style.css';
import {Link} from "react-router-dom";
import Footer from "../Footer";

function CheckoutConfirmPage(props) {
    const [ccInfo,setCCInfo] = useState([]);

    useEffect(()=>{
        fetch("http://localhost:8080/account/getAll")
        .then(res=>res.json())
        .then((ccInfo)=>{
            setMovies(ccInfo);
        })
    },[])

    return (
        <React.Fragment>
            <NavBar/>
            {/* Payment Info and Promo Code */}
            <div className='checkout'>
                <div className="registration-confirmation">
                <div className="input-group">
                            <h3>Card Info</h3>
                            <label htmlFor="card-type">Card Type</label>
                            <input type="text" name="card-type" placeholder="Visa"/>
                            <label htmlFor="card-number">Card Number</label>
                            <input type="text" name="card-number" placeholder="1111 1111 1111 1111"/>
                            <label htmlFor="security-number">Card Security Number</label>
                            <input type="text" name="card-number" placeholder="000"/>
                            <label htmlFor="security-number">Expiration Date</label>
                            <input type="month" name="card-number" placeholder="MM/YY"/>
                        </div>
                        <p></p>
                        <div className="input-group">
                            <h3>Billing Address</h3>
                            <label htmlFor="full-name">Full Name</label>
                            <input type="text" name="full-name" placeholder="Ex: John Doe" value={fullName}/>
                            <label htmlFor="street">Street</label>
                            <input type="text" name="address" placeholder="Ex: 111 Go Dawgs Road" value={address}/>
                            <label htmlFor="city">City</label>
                            <input type="text" name="city" placeholder="Ex: Athens" value={city}/>
                            <label htmlFor="state">State</label>
                            <input type="text" name="state" placeholder="Ex: Georgia" value={state}/>
                            <label htmlFor="zip">Zip Code</label>
                            <input type="text" name="zip" placeholder="Ex: 00000" value={zip}/>
                        </div>
                </div>

                <div className="book-ticket-confirmation">
                    <Link className="book-tickets-cancellation-link" to={`/`}><h2>CANCEL</h2></Link>
                    <Link className="book-tickets-confirmation-link" to={`/booktickets/checkout/confirmation`}><h2>CONFIRM</h2></Link>
                </div>
            </div>

            <div className="checkout-links">
                    <Link className="movie-btn" to={`/`}><h2>CANCEL</h2></Link>
                    <Link className="movie-btn" to={`/booktickets/checkout/confirmation`}><h2>CONFIRM</h2></Link>
                </div>
            <Footer/>
        </React.Fragment>
    );
};

export default CheckoutConfirmPage;
